import { useQuery, gql } from '@apollo/client';
import Link from './../components/Link';

const FEED_QUERY = gql`
  {

  post(id: 2) {
    id
    author {
      firstName
      posts {
        id
        body
      }
    }
    body
  }

  }
`;

const Visits = () => {
  const { data } = useQuery(FEED_QUERY);

  return (
    <div>
      {data && (
        <>
          {data.feed.links.map((link) => (
            <Link key={link.id} link={link} />
          ))}
        </>
      )}
    </div>
  );
};


export default Visits;
